class Solution(object):    def findTargetSumWays(self, nums, S):        """        :type nums: List[int]        :type S: int        :rtype: int        """        dict1={}        if nums[0]!=0:            dict1[nums[0]]=1            dict1[-nums[0]]=1        else:            dict1[0]=2        for i in range(1,len(nums)):            dict2={}            for key,val in dict1.items():                if key+nums[i] not in dict2:                    dict2[key+nums[i]]=val                else:                    dict2[key+nums[i]]+=val                if key-nums[i] not in dict2:                    dict2[key-nums[i]]=val                else:                    dict2[key-nums[i]]+=val            dict1=dict2        if S in dict1:            return dict1[S]        else:            return 0nums=[1]s1=2s=Solution()print(s.findTargetSumWays(nums,s1))